    }

span.item_name{
display:block;
width:400px;
/*background-color:#FDE3A7;黄色いところ*/
}


span.price1 {
    font-size: 110%;
    font-weight: bold;
    line-height: 160%;
    position: relative;
    top: 6px;
}

span.price2 {
    font-size: 200%;
    font-weight: bold;
}

#rakutenLimitedId_cart span.price2 + span.tax_postage, #rakutenLimitedId_cart span.tax_postage + span.tax_postage {
    font-size: 12px;
}

#container {
  width:950px;
  margin:0 auto;
}
